window.bookSummaryJSON = "<p>She's in for the fight of her life with the man who only wants to be her lover. </p> <p>Fighter Mia Anderson has faced the dark side of life and survived. But just getting by is no longer enough. To fund her new life with her baby sister, she's determined to beat the reigning king of the male fighters in New York's underground MMA circuit, Tray \"Fox\" Knox. </p> <p>Tray refuses to fight a woman, until he learns Mia's tougher than anyone he has ever known. He soon realizes he wants more from her than blows and blood, and he's willing to hit below the belt to get it. He'll fight her, but if he wins, she spends the night in his bed. All night long, his rules. No tapping out. </p> <p>Mia agrees, certain that he'll lose. What she doesn't realize is that Tray loves to fight dirty and that this match may end up being the most important one of their lives. </p> <p>Warning: Please be advised this book contains content some may find triggering (past sexual trauma) and also contains graphic sex and language that may not be suitable for underage audiences. </p>"; 
